import mongoose from "mongoose"

const postSchema = new mongoose.Schema({
    title: {
        type: String,
        required: true
    },
    description: {
        type: String,
    },
    image: {
        type: String,
        required: true,
        default: "data:image/jpeg;base64,"
    },
    farmer: {
        type: mongoose.Schema.Types.ObjectId,
        ref: "Farmer",
        required: true
    }, // need to add date
    doctor: {
        type: mongoose.Schema.Types.ObjectId,
        ref: "Doctor",
        required: true
    } // need to add date
},
    {
        timestamps: true
    }
)

const Post = mongoose.model("Post", postSchema)
export default Post;
